import React, {useState, useEffect} from "react"
import {useHistory} from "react-router-dom"
import Button from "react-bootstrap/Button"

export default function History(){
    //gallons, delivery address, delivery datae, price/gallon, amount due
    var [rows1, setRows1] = useState([])

    var example = rows1.map((r) =>(
        <p>{r}</p>
    ))
    useEffect(() => {
        const addRow = async () =>{
            setRows1(['row 1', 'row 2', 'row3'])
        }

        addRow()
    })
    return(
        <div>
            <table>
                <tr>
                    <td>Gallons</td>
                    <td>Address</td>
                    <td>Delivery Date</td>
                    <td>Price per gallon</td>
                    <td>Amount Due</td>
                </tr>
                {example}
            </table>
            <Button onClick={addRow}>ADD</Button>
        </div>
    )
}
